import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-server',
  templateUrl: './server.component.html',
  styleUrls: ['./server.component.css']
})
export class ServerComponent {
  @Input()
  serverName!: string;
  @Input()
  pfp!: string;
}
<details class="dropdown mb-32 ">
    <summary class=" btn bg-[#404040] h-[10vh] w-[42vh] rounded-none z-0 items-center hover:bg-[#2B2B2B] border-none">
        <div class="h-[6.5vh] w-[6.5vh]">
            <img class="rounded-full" src="data:image/jpeg;base64, {{pfp}}">
        </div>
        <div class="textosexo normal-case">
            <p># {{serverName}}</p>
        </div>
    </summary>
    <ul class="p-2 shadow menu dropdown-content w-52 bg-[#404040] ml-[10vh]">
      <app-channel></app-channel>
    </ul>
</details>
